  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <a className="navbar-brand" href="/">
          {/* Logo de votre application */}
          <img src="chemin_vers_votre_logo.png" alt="Logo" width="30" height="30" className="d-inline-block align-top" />
        </a>
        <form className="d-flex">
          <input className="form-control me-2" type="search" placeholder="Rechercher" aria-label="Rechercher" />
          <button className="btn btn-outline-primary" type="submit">Rechercher</button>
        </form>
        <button className="btn btn-outline-danger" onClick={handleLogout}>Déconnexion</button>
      </div>
    </nav>
  );
};

export default Navbar;
